        "Tab": "UI_LegendQuestImg_Mizuki",
        "Icon": "UI_ChapterIcon_Mizuki",
        "Intro": "According to Inazuman folklore, as the day wanes and eyelids grow heavy, a chubby little creature may visit those blessed by fortune. Should this happen, you'd best set aside whatever it is you're doing and go to sleep immediately, for this cute critter is a baku — a youkai who feeds on nightmares.<br>The current inhabitants of Inazuma, however, need not be particularly well-blessed to rid themselves of unpleasant dreams. All they need do is book an appointment at the Aisa Bathhouse in Inazuma City. Rumor has it that each of the bathhouse's therapists is a baku in the guise of a young woman, and that they have helped many a nightmare-plagued patient find release from their troubles.<br>Nevertheless, the once-flourishing Aisa Bathhouse appears to be facing a financial crisis. To understand why, you must first rest your weary head and seek an encounter in the realm of dreams..."
